import collectionsReducer from '../reducers/collectionsReducer'

export const CollectionsContext = createContext('init')

interface Props {
    children: React.ReactNode;
}

let initState = {
    collections: [],
    current: "init",
    open: false,

}

const CollectionsContextProvider: React.FC<Props> = (props) => {
    const [collections, dispatch] = useReducer(collectionsReducer, {initState})
     return(
        <CollectionsContext.Provider value="hi">
        {props.children}
        </CollectionsContext.Provider>
    )
}


export default CollectionsContextProvider
